import ShopData from './shop-data';

const INITIAL_STATE={
    ShopPage : ShopData
}




const ShopPageReducer = (state =INITIAL_STATE, action ) => {
    switch (type.action) {
        default:
            return
    }
}

export default ShopPageReducer;
